import React from 'react'
import { Navigate, Outlet } from 'react-router-dom';

function ProtectedRoute() {
    const auth=JSON.parse(localStorage.getItem("user"));
  return (
   <>
   {auth ? <Outlet/>: <Navigate path="/"/>}
   </>
  )
}

export default ProtectedRoute
